$(document).ready(function(){const n=$("#contact");let t="\n      <h1>Follow me at:</h1>\n      <br>\n      ";$.ajax({url:"../content/contact-content.json",method:"GET"}).then(o=>{o.contacts.forEach(n=>{t+=`\n      <a href="${n.url}" target="_blank">${n.icon}</a> ---- \n      `}),t+="\n    </br>\n    ",n.html(t)})});